// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.8.2 <0.9.0;

/**
 * @title Factory
 * @dev Factory Smart Contract
 */

import "./Pool.sol";

contract Factory {


    address owner;

    constructor () {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "You are not the owner");
        _;
    }

    Pool pool;
    Pool[] public pools;


    function createPool(string memory _question, string[] memory _proposals) public  {
        pool = new Pool(_question, _proposals);
        pools.push(pool);

    }

    function getquestion(uint _id) public view returns(uint) {
        Pool poolin = pools[_id];
        return poolin.GetQuestion();

    }

    function test() public view returns(address){
        return msg.sender;
    }



}
